import React from 'react';
import { Avatar, Card } from 'antd';

const UserProfile = () => {
  <Card
    actions={[
      <div key="twit">
        짹쨱
        <br />
      </div>,
    ]}
  >
    <Card.Meta avatar={<Avatar>HW</Avatar>} title="Hwan" />
  </Card>;
};

export default UserProfile;
